import React from 'react';

export default function SingleSong(props) {
  return (
    <tr className="singleSong">
      <th>{props.title}</th>
      <th>{props.artist}</th>
      <th>{props.album}</th>
      <th>{props.length}</th>
      <th>{props.upvotes}</th>
      Title: {props.title}, Artist: {props.artist}, Album: {props.album},
      Length: {props.length}
    </tr>
  );
}
